import { Box } from "@mui/material";
import { themes } from "../../../config/icons";

const body = () =>{

    const themeMode = themes.light

    return (
        <Box
            display="flex"
            padding="0px 8px"   
        >
            <Box padding="0px 8px">
                <Box component={"img"} src={themeMode.imagen.imgnovia} marginBottom="12px"/>
                <Box component={"img"} src={themeMode.imagen.imgrisco} marginBottom="12px"/>
            </Box>
            <Box padding="0px 8px">
                <Box component={"img"} src={themeMode.imagen.imgnadando} marginBottom="12px"/>
                <Box component={"img"} src={themeMode.imagen.pl} marginBottom="12px"/>
            </Box>
        </Box>
    );
}

export default body;
